import React from "react";
import "./App.css";
import friends from "./data";

class App extends React.Component {
  state = {
    friends
  };
  renderFriends = () => {
    return this.state.friends.map(friend => (
      <img className="friend" src={friend.image} />
    ));
  };
  render() {
    return <div className="App">{this.renderFriends()}</div>;
  }
}

export default App;
